import React, { Component, useEffect, useState } from "react";
import { useParams } from "react-router-dom";

const DetailView = (props) => {

  const [posts, setPosts] = useState([]);
  useEffect(() => {
      setPosts(props.data);
  }, [props]);

  return(
    <div>
        <p>{posts.content}</p>
    </div>
  ); 
};

export default DetailView;
